import React,{Component} from 'react';

class TodoLabel extends Component{
    constructor(props){
       super(props);
       const dato=this.props.cosas.match.params
       //console.log(props)
       //console.log(dato)
        this.state={
            prioridad1: props.valor1,
            prioridad2: dato.id
        }

    };  

    render(){
         return(
            <div className="col-md-2">
              <h1>soy compo1 valor={this.state.prioridad1}</h1>
              <h1>dato URL={this.state.prioridad2}</h1>
            </div>            
        )
    }

}
export default TodoLabel;
